import React from 'react';
import {
  MDBCarousel,
  MDBCarouselItem,
} from 'mdb-react-ui-kit';



const Home = () => {
    return (
       <div className="main">
        <div className="slide">
        <MDBCarousel>
      <MDBCarouselItem
        className='w-100 d-block'
        itemId={1}
        src={acctof}
        alt='...'
      />
      <MDBCarouselItem
        className='w-100 d-block'
        itemId={2}
        src={acctof}
        alt='...'
      />
      <MDBCarouselItem
        className='w-100 d-block'
        itemId={3}
        src={acctof}
        alt='...'
      />
    </MDBCarousel>
        </div>
       </div>
    );
}

export default Home;
